import React from "react";
import Slider from "infinite-react-carousel";

import telefunken from "./data/telefunken.jpg";
import kent from "./data/kent.jpg";
import filtre from "./data/GREEN-FILTRE-PACK-3.jpg";
import "./slide.css";

function Slide() {
    const SlickArrowLeft = ({ currentSlide, slideCount, ...props }) => (
        <img src="./arrow-left.png" alt="prevArrow" {...props} />
    );
    const SlickArrowRight = ({ currentSlide, slideCount, ...props }) => (
        <img src="/arrow-right.png" alt="nextArrow" {...props} />
      );
  const settings = {
    autoplay: true,
    autoplaySpeed: 5000,
    className: "slide_box",
    dots: true,
    virtualList: true,
    duration: 20,
    arrows:true,
    prevArrow: <SlickArrowLeft />,
    nextArrow: <SlickArrowRight />,
  };
  return (
    <div>

      <Slider {...settings}>
        <div className="row">
          <img
            src={telefunken}
            className="slide_img col-lg-12"
            alt="Responsive img"
          />

        </div>
        <div>
          <img
            src={kent}
            className="slide_img col-lg-12"
            alt="Responsive img"
          />

        </div>
        <div>
          <img
            src={filtre}
            className="slide_img col-lg-12"
            alt="Responsive img"
          />

        </div>
      </Slider>
    </div>
  );
}

export default Slide;
